import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
} from "react-router-dom";
import './App.scss';
import AppBar from '@material-ui/core/AppBar';
import Home from '../components/Home/Home';
import Event from './Basic/Event';
import Faq from './Basic/Faq';
import Product from "./Basic/Product";
import Register from '../components/Register/Register';
import Bottom from '../components/Bottom/Bottom';
import Login from '../components/Login/Login'
import {Container, Toolbar, Typography, Button, Icon} from "@material-ui/core";
import UserDetail from "./UserDetail/UserDetail";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import Drawer from "@material-ui/core/Drawer";
import {createStyles, makeStyles, Theme} from "@material-ui/core/styles";
import Summary from "./AccountSummary/summary";
const drawerWidth = 270;
const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            display: 'flex',
            minHeight: '800px'
        },
        drawer: {
            width: drawerWidth,
            flexShrink: 0,
        },
        drawerPaper: {
            width: drawerWidth,
        },
        content: {
            flexGrow: 1,
            padding: theme.spacing(3),
        },
        toolbar: theme.mixins.toolbar,
        nested: {
            paddingLeft: theme.spacing(4),
        },
    }),
);

export default function App() {
    const classes = useStyles();
    return (
            <Router>
                <AppBar position="fixed" className='menu'>
                    <Container>
                        <Toolbar>
                            <Typography variant="h6"  align="left">
                                <Link to="/products"><Button>Products</Button></Link>
                            </Typography>
                            <Typography variant="h6"  align="left" >
                                <Link to="/event"><Button>Event</Button></Link>
                            </Typography>
                            <Typography variant="h6" align="left">
                                <Link to="/faq"><Button>FAQ</Button></Link>
                            </Typography>
                            <Typography variant="h6"  align="left">
                                <Link to="/usermenu"><Button>UserMenu</Button></Link>
                            </Typography>
                            <Typography variant="h6"  align="left">
                                <Link to="/summary"><Button>Summary</Button></Link>
                            </Typography>
                            <Typography variant="h6" align="right" className='login'>
                                <Link to="/signIn"><Button>SignIn</Button></Link>
                            </Typography>
                            <Typography align="right">
                                <Link to="/register"><Button>Register</Button></Link>
                            </Typography>
                        </Toolbar>
                    </Container>
                </AppBar>
                <Drawer
                    className={classes.drawer}
                    variant="permanent"
                    classes={{
                        paper: classes.drawerPaper,
                    }}>
                    <List>
                        <ListItem button component={props => <Link {...props} to='summary'/>}>
                            <ListItemIcon>
                                <Icon>Home</Icon>
                            </ListItemIcon>
                            <ListItemText primary='Test Router'/>
                        </ListItem>
                        <ListItem button component={props => <Link {...props} to='summary'/>}>
                            <ListItemIcon>
                                <Icon>Home</Icon>
                            </ListItemIcon>
                            <ListItemText primary='Test Router'/>
                        </ListItem>
                    </List>
                    <div className={classes.toolbar}/>
                </Drawer>
                <Switch>
                    <Route path="/usermenu" component={UserDetail}/>
                    <Route path="/products">
                        <Product/>
                    </Route>
                    <Route path="/event">
                        <Event/>
                    </Route>
                    <Route path="/faq">
                        <Faq/>
                    </Route>
                    <Route path="/signIn">
                        <Login/>
                    </Route>
                    <Route path="/register">
                       <Register/>
                    </Route>
                    <Route path="/summary" component={Summary} />
                    <Route path="/">
                        <Home/>
                    </Route>
                </Switch>

                <Bottom/>
            </Router>
    );
}
